import React from "react";
import { Link } from "react-router-dom";

const SideBar = () => {
  return (
    <>
      <div class="list-group">
        <Link
          to="#"
          class="list-group-item list-group-item-action  bg-secondary text-white"
        >
          Admin
        </Link>
        <Link to="exam" class="list-group-item list-group-item-action">
          Exam
        </Link>
        <Link to="topic" class="list-group-item list-group-item-action">
          Topic
        </Link>
        <Link to="questions" class="list-group-item list-group-item-action">
          Questions
        </Link>
      </div>
    </>
  );
};

export default SideBar;
